import React from "react";


export const Sasi=()=>{
    return(
    <ul>
        <li>manoj</li>
        <li>kumar</li>
    </ul>
    )
}
export const Mani=()=>{
    return(
        <table>
        <tr>
          <th>Company</th>
          <th>Contact</th>
          <th>Country</th>
        </tr>
        <tr>
          <td>Alfreds Futterkiste</td>
          <td>Maria Anders</td>
          <td>Germany</td>
        </tr>
        <tr>
          <td>Centro comercial Moctezuma</td>
          <td>Francisco Chang</td>
          <td>Mexico</td>
        </tr>
      </table>
    )
}
